 var heartSymbol = document.createElement("i");
 heartSymbol.setAttribute("class","fa-solid fa-heart");
 heartSymbol.style.fontSize = "25px";
 if(ele.wishlist=="false"){
 heartSymbol.style.color = "white";
 }
 else if(ele.wishlist=="true"){
    heartSymbol.style.color="rgb(255,56,92)";
 }
//  heartSymbol.style.fill = "rgb(38,37,37)";
 heartSymbol.setAttribute("id", "heartSymbol")
 heartSymbol.addEventListener("click", wishlist);

 function wishlist(){
    if(ele.wishlist=="false"){
    wishlist_data.push(ele);
    localStorage.setItem("wishlist", JSON.stringify(wishlist_data) )
    
    heartSymbol.style.color="rgb(255,56,92)";
    ele.wishlist="true";
    localStorage.setItem("Amazing_view",JSON.stringify(Data));
    append(Data)
}
else if(ele.wishlist=="true"){
    heartSymbol.style.color = "white";
    ele.wishlist="false";
    localStorage.setItem("Amazing_view",JSON.stringify(Data));
    append(Data)
}
}

